CREATE TABLE SPY (
    [Date] DATETIME,
    [Open] NUMERIC(9, 6),
    [High] NUMERIC(9, 6),
    [Low] NUMERIC(9, 6),
    [Close] NUMERIC(9, 6),
    [Volume] NUMERIC(10, 1),
    [Dividend] NUMERIC(6, 5),
    [Split] NUMERIC(2, 1),
    [Adj_Open] NUMERIC(18, 15),
    [Adj_High] NUMERIC(18, 15),
    [Adj_Low] NUMERIC(18, 15),
    [Adj_Close] NUMERIC(18, 15),
    [Adj_Volume] NUMERIC(10, 1)
);
